import React, { useEffect, useState } from 'react';
import axios from 'axios';

const FuckComponent = () => {
    const [fucks, setFucks] = useState([]);

    useEffect(() => {
        axios.get('/api/fucks/lists')
            .then(response => {
                setFucks(response.data);
            })
            .catch(error => {
                console.error('Error fetching fucks:', error);
            });
    }, []);

    return (
        <div>
            <h1>Fucks</h1>
            <ul>
                {fucks.map(f => (
                    <li key={f.id}>{f.name}</li>
                ))}
            </ul>
        </div>
    );
}

export default FuckComponent;
